import {Link} from "react-router-dom";
import React from "react";

const NewObject = () => {
    return (
        <div className="menu">
            <div className="menu-item">
                <Link to="/">Присоединиться</Link>
            </div>
            <div className="menu-item active">
                <Link to="/objects">Создать предмет</Link>
            </div>
        </div>
    );
};

export default NewObject;
